"""### 4-02 리스트(list)
- 리스트는 여러 가지 형태의 값을 하나의 순서가 있는 배열 형태로 묶어 놓은 것
   - 리스트는 모든 type의 객체를 item으로 할 수 있음
- 파이썬에서 가장 많이 사용되며, 유연한 구조의 데이터 타입
- 리스트 내의 항목들은 쉼표로 구분하고 사각 괄호[ ] 안에 포함됨
- Slicing을 이용하여 리스트의 일정 범위 항목을 쪼개어 가져오거나 한 항목을 가져올 수 있음
- 리스트의 각 항목은 변겨이 가능
   - x[0] = 10

#### 4-02-01 리스트(list) 생성
"""

